    <div>
      <h3>{dog.name}</h3>
      <p>Temperaments: {dog.temperaments.join(', ')}</p>
      <p>Weight: {dog.weight}</p>  
      <img src={dog.image} alt={dog.name}/>
      <Link to={`/dogs/${dog.id}`}>View detail</Link>
    </div>
  );
};

